import React from "react";
import "./Projects.css";
import db from "./db.json";

const AllProj = () => {
  return (
    <div>
      {db[0].project.map((e) => (
        <div className="row" key={e.sNo}>
          <div className="col-xl-6">Images</div>
          <div className="col-xl-6">About</div>
        </div>
      ))}
    </div>
  );
};

export default AllProj;
